var b="url",c="4_0_2_-_error_example_-_your_details_-_all_fields.html",d="generationDate",e=new Date(1452074879503.9),f="isCanvasEnabled",g=false,h="variables",i="OnLoadVariable",j="EmailVar",k="FullnameVar",l="ContactnumVar",m="UrnVar1",n="UrnVar2",o="UrnVar3",p="UrnVar4",q="DayVar",r="MonthVar",s="YearVar",t="AcoomodationVAR",u="InsuranceVAR",v="UtilityVAR",w="CounilTaxVAR",x="TVVAR",y="TravelVAR",z="LoanVAR",A="ChildVAR",B="TelephoneVAR",C="CountyCourtVAR",D="NumChargesVAR",E="page",F="packageId",G="5e0923a65002405e9b638caa115d41ef",H="type",I="Axure:Page",J="name",K="4.0.2 - Error example - Your details - all fields",L="notes",M="Note",N="<p><span style=\"font-family:'Arial-BoldMT', 'Arial Bold', 'Arial';font-weight:700;\">Error notification</span><span></span></p><p><span>&nbsp;</span></p><p><span>Example demonstrates each potential error if the user had not selected or provided the mandatory field information</span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\"></span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\">The user is notified and instructed to check and try again.</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\">&nbsp;</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\">Updates are the additional error is the user hadn't selected a Yes or No answer for the following two questions:</span></p><p><span style=\"font-family:'GDSTransportWebsite-Bold', 'GDS Transport Website Bold', 'GDS Transport Website';font-weight:700;\">Do you have a National Insurance number?</span></p><p><span style=\"font-family:'GDSTransportWebsite-Bold', 'GDS Transport Website Bold', 'GDS Transport Website';font-weight:700;\">Do you have a UK driving licence number?</span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\"></span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\">&nbsp;</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\">Notification header instruction should read:</span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;text-decoration:underline;color:#1E1E1E;\"></span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;text-decoration:underline;color:#1E1E1E;\">You must tell us if you have a National Insurance number</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;text-decoration:underline;color:#1E1E1E;\">You must tell us if you have a UK Driving licence number</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;text-decoration:underline;color:#1E1E1E;\">&nbsp;</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\">Each error instruction should read:</span></p><p><span style=\"font-family:'GDSTransportWebsite-Bold', 'GDS Transport Website Bold', 'GDS Transport Website';font-weight:700;\">Do you have a National Insurance number?</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#CC0000;\">Tell us if you have a National Insurance number</span><span style=\"font-family:'GDSTransportWebsite-Bold', 'GDS Transport Website Bold', 'GDS Transport Website';font-weight:700;\"></span></p><p><span style=\"font-family:'GDSTransportWebsite-Bold', 'GDS Transport Website Bold', 'GDS Transport Website';font-weight:700;\">Do you have a UK driving licence number?</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#666666;\">Entering your driving licence number means you don't have to send your licence to the court.</span><span style=\"font-family:'GDSTransportWebsite-Bold', 'GDS Transport Website Bold', 'GDS Transport Website';font-weight:700;\"></span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#CC0000;\">Tell us if you have a UK driving licence</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#CC0000;\">&nbsp;</span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\">Other error if the user selected yes to </span><span style=\"font-family:'GDSTransportWebsite-Bold', 'GDS Transport Website Bold', 'GDS Transport Website';font-weight:700;\">Do you have a UK driving licence number? </span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#1E1E1E;\">but didn't provide a number</span><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#CC0000;\"></span></p><p><span style=\"font-family:'GDSTransportWebsite', 'GDS Transport Website Light', 'GDS Transport Website';font-weight:200;color:#CC0000;\">Tell us your UK driving licence number</span></p>",O="style",P="baseStyle",Q="627587b6038d43cca051c114ac41ad32",R="pageAlignment",S="center",T="fill",U="fillType",V="solid",W="color",X